How to insert a new item to mLab array according to a specific id<p>I use mLab for my database. I have a collection of lists where each list has an object with _id, userId and an array of items.</p>

<p>Now I want to add a new item to the array of a specific list.</p>

<p>The function that connects to Mongo has the new item object and the list id.</p>

<p>How do I find the correct list and add the new item to items array?</p>

<p>the JSON of each list looks like this:</p>

<pre><code>{
    "_id": {
        "$oid": "5ded5eb7e7179a3015b0672f"
    },
    "userID": "1234",
    "items": [
        {
            "_id": "abc12345",
            "name": "abc",
        },
        {
            "_id": "abc12346",
            "name": "def",
        }
    ]
}
</code></pre>

<p>and the function that connects to Mongo looks like this: </p>

<pre class="lang-js prettyprint-override"><code>function addItem({item, listId}) {
    return MongoService.connect()
    .then(db =&gt; {
        const collection = db.collection('lists');
        //need to do something here
    })
}
</code></pre>

<p>connect to Mongo : (which works fine, I do connect and load the lists)</p>

<pre class="lang-js prettyprint-override"><code>function connectToMongo() {
    if (dbConn) return Promise.resolve(dbConn);
    const MongoClient = require('mongodb').MongoClient;
    const url = 'mongodb:// ***my user and password ***';
    return MongoClient.connect(url)
        .then(client =&gt; {
            console.log('Connected to MongoDB');
            client.on('close', ()=&gt;{
                console.log('MongoDB Diconnected!');
                dbConn = null;
            })
            dbConn = client.db()
            return dbConn;
        })
}
module.exports = {
    connect : connectToMongo
}
</code></pre>

