How to access multiple MongoDB collections from state using Express?<h2>Scenario</h2>
<p>To use a many-to-many relationship I am trying to read documents from different collections within a single MongoDB database. I have a backend called <code>server.js</code> which &quot;reads&quot; the collection locations from files <code>university.js</code> and <code>faculty.js</code>. I made two separate <code>router.get</code> methods for them. Each of them individually works, and I am trying to add the 2nd <code>router.get</code> method into a different &quot;state&quot; called &quot;Faculties&quot;.</p>
<h2>Example files</h2>
<p><code>faculty.js</code> (analogous to <code>universities.js</code>)</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const Schema = mongoose.Schema;

// Create another collection
const FacultyCollection = new Schema(
  {
    name: String,
    amountOfBuildings: Number
  },
  { collection: 'faculties' },
  { timestamps: true ,useUnifiedTopology: true}
);

// export the new Schema so we could modify it using Node.js
module.exports = mongoose.model(&quot;faculties&quot;, FacultyCollection);
</code></pre>
<p><code>router.get</code>.. method (analogous to universities)</p>
<pre><code>router.get('/getFaculties', (req, res) =&gt; {
  Faculties.find((err, data) =&gt; {
    if (err) return res.json({ success: false, error: err });
    return res.json({ success: true, data: data });
  });
});
</code></pre>
<p><code>App.js</code> <code>state</code> and <code>getFaculties</code>:</p>
<pre><code>state = {
        data: [],
        id: 0,
        message: null,
        intervalIsSet: false,
        idToDelete: null,
        idToUpdate: null,
        objectToUpdate: null,
    };

faculties = {
        data: [],
        id: 0,
        message: null,
        intervalIsSet: false,
        idToDelete: null,
        idToUpdate: null,
        objectToUpdate: null,
    };

    componentDidMount() {
        this.getDataFromDb();
        if (!this.state.intervalIsSet) {
            let interval = setInterval(this.getDataFromDb, 5000);
            this.setState({ intervalIsSet: interval });
        }
    }

    componentWillUnmount() {
        if (this.state.intervalIsSet) {
            clearInterval(this.state.intervalIsSet);
            this.setState({ intervalIsSet: null });
        }
    }

    getDataFromDb = () =&gt; {
        fetch('http://localhost:3001/api/getFaculties')
                .then((data) =&gt; data.json())
                .then((res) =&gt; this.setState({ data: res.data }));
    };
</code></pre>
<p>Example <code>render</code> to display the data from the faculty collection:</p>
<pre><code>render() {
    const { data } = this.state;
    const { faculties } = this.faculties;
    return (
      &lt;div&gt;
        {/*This folds the data of the state into an array with university names*/}
        dat.name={data.map((dat) =&gt; dat.name)}

        {/*This is intended to fold the data of the faculties into an array with faculty names*/}
        dat.name={faculties.map((dat) =&gt; dat.name)}
     &lt;/div&gt;
  );
}

</code></pre>
<h2>Question</h2>
<p>How can I store and read the the names of the <code>faculty</code> collection (from the/a state) (on the same page) when I also display the university names from the state?</p>

