Embed Field: Deserializing from BsonDocument to string and serializing back to BsonDocument<p>I have a requirement where I need a property that is actually a JSON value from a MongoDB collection that needs to be deserialized into a string. This conversion is throwing a <em>"Cannot deserialize a 'String' from a BsonType 'Document'"</em> exception. </p>

<p>I tried implementing a JSON custom converter, but as the value is being treated as a BsonDocument, it is not helping and I am getting the same exception. I also need it in the original format as I need to cast it back into a BsonDocument down the line. I guess I would need a custom Bson serializer/deserializer. </p>

<p>Incoming sample document from MongoDB collection:</p>

<pre><code>{
    "name": "Jane Doe",
    "dob": {
        "month": "Sep",
        "day": 09,
        "year": 1987
    }
}
</code></pre>

<p>Type it is expecting for deserialization:</p>

<pre><code>public class Person
{
    public string name { get; set; }
    public Dob dob { get; set; }

    public class Dob
    {
        public string month { get; set; }
        public int day { get; set; }
        public int year { get; set; }
    }
}
</code></pre>

<p>Type I want it to deserialize into:</p>

<pre><code>public class Person
{
    public string name { get; set; }
    public string dob { get; set; }
}
</code></pre>; Answer: Yes,  The cell has a number format applied to it so it shows the zeros, but because the `&` concatenates it into a string the number format does not apply.  So one must apply the TEXT() Function to make the string format work.  Another option would have been to apply a number format of `#0.00 \T\o\t\a\l` and the under pinning number would remain accesible for future maths, while showing the text as the OP wanted.

